/* ── THREE.JS HERO: Particle Network ── */
(function(){
  const c = document.getElementById('hero-canvas');
  const R = new THREE.WebGLRenderer({canvas:c, antialias:true, alpha:true});
  R.setPixelRatio(Math.min(devicePixelRatio,2));
  R.setSize(c.offsetWidth, c.offsetHeight);
  const scene = new THREE.Scene();
  const cam = new THREE.PerspectiveCamera(60, c.offsetWidth/c.offsetHeight, 0.1, 1000);
  cam.position.set(0,0,24);

  const N=180, pos=new Float32Array(N*3), spd=[], nds=[];
  for(let i=0;i<N;i++){
    const x=(Math.random()-.5)*50,y=(Math.random()-.5)*30,z=(Math.random()-.5)*20;
    pos[i*3]=x;pos[i*3+1]=y;pos[i*3+2]=z;
    spd.push({x:(Math.random()-.5)*.012,y:(Math.random()-.5)*.008,z:(Math.random()-.5)*.005});
    nds.push(new THREE.Vector3(x,y,z));
  }
  const geo=new THREE.BufferGeometry();
  geo.setAttribute('position',new THREE.BufferAttribute(pos,3));
  scene.add(new THREE.Points(geo,new THREE.PointsMaterial({color:0x5b9bd5,size:.18,transparent:true,opacity:.75})));

  const lg=new THREE.Group(); scene.add(lg);
  function bL(){ lg.clear(); for(let i=0;i<N;i++) for(let j=i+1;j<N;j++){const d=nds[i].distanceTo(nds[j]);if(d<7){const g=new THREE.BufferGeometry().setFromPoints([nds[i].clone(),nds[j].clone()]);lg.add(new THREE.Line(g,new THREE.LineBasicMaterial({color:0x4a8ab5,transparent:true,opacity:(1-d/7)*.2})));}} }
  bL();

  const rings=[];
  for(let i=0;i<3;i++){const r=new THREE.Mesh(new THREE.RingGeometry(3+i*3.5,3.06+i*3.5,64),new THREE.MeshBasicMaterial({color:0xc4622d,transparent:true,opacity:.06-i*.015,side:THREE.DoubleSide}));r.rotation.x=Math.PI/4+i*.3;r.rotation.z=i*.5;scene.add(r);rings.push(r);}

  let mx=0,my=0,lt=0;
  document.addEventListener('mousemove',e=>{mx=(e.clientX/innerWidth-.5)*2;my=-(e.clientY/innerHeight-.5)*2;});

  (function A(){requestAnimationFrame(A);
    for(let i=0;i<N;i++){nds[i].x+=spd[i].x;nds[i].y+=spd[i].y;nds[i].z+=spd[i].z;
      if(Math.abs(nds[i].x)>26)spd[i].x*=-1;if(Math.abs(nds[i].y)>16)spd[i].y*=-1;if(Math.abs(nds[i].z)>12)spd[i].z*=-1;
      pos[i*3]=nds[i].x;pos[i*3+1]=nds[i].y;pos[i*3+2]=nds[i].z;}
    geo.attributes.position.needsUpdate=true;
    if(++lt%8===0)bL();
    rings.forEach((r,i)=>{r.rotation.z+=.001*(i+1);r.rotation.y+=.0005;});
    cam.position.x+=(mx*3-cam.position.x)*.03;cam.position.y+=(my*2-cam.position.y)*.03;cam.lookAt(0,0,0);
    R.render(scene,cam);
  })();
  window.addEventListener('resize',()=>{R.setSize(c.offsetWidth,c.offsetHeight);cam.aspect=c.offsetWidth/c.offsetHeight;cam.updateProjectionMatrix();});
})();

/* ── BODY MAP 3D GLB ── */
function initBodyMap(){
  if(typeof THREE==='undefined'){console.error('THREE not loaded');return;}
  if(typeof THREE.GLTFLoader==='undefined'){console.error('GLTFLoader not loaded');return;}

  // Exact normalised Y ranges (0=feet,1=head) from actual vertex analysis
  const SLIDES=[
    {id:0,name:'Head & Neck',  hex:'#2979d5',col:0x2979d5,xMax:null,
     desc:'Cervical spine rehabilitation, headache management, TMJ disorders and post-whiplash recovery.',
     points:['Cervical Spine','C1\u2013C7 Discs','Occipital','TMJ','Trapezius','SCM Muscle'],
     yMin:0.844,yMax:0.974},
    {id:1,name:'Upper Body',   hex:'#e06020',col:0xe06020,xMax:null,
     desc:'Shoulder impingement, rotator cuff tears, elbow and wrist rehabilitation.',
     points:['AC Joint','Rotator Cuff','Biceps Tendon','Lateral Epicondyle','Medial Epicondyle','Wrist Flexors','Thoracic Outlet'],
     yMin:0.740,yMax:0.875},
    {id:2,name:'Core & Spine', hex:'#d4a010',col:0xd4a010,xMax:0.062,
     desc:'Lumbar disc herniations, scoliosis, thoracic dysfunction and deep core stabilisation.',
     points:['Diaphragm','Thoracic T6\u2013T12','L1\u2013L3 Discs','L4\u2013L5 Disc','L5\u2013S1 Junction','Transverse Abs','Multifidus'],
     yMin:0.600,yMax:0.800},
    {id:3,name:'Hip & Pelvis', hex:'#1aa0b8',col:0x1aa0b8,xMax:0.072,
     desc:'Hip impingement (FAI), labral tears, groin strains and pelvic floor dysfunction.',
     points:['Hip Flexors','Femoral Head','Greater Trochanter','Gluteus Medius','Pelvic Floor','Iliotibial Band','Piriformis'],
     yMin:0.540,yMax:0.640},
    {id:4,name:'Lower Body',   hex:'#d43020',col:0xd43020,xMax:null,
     desc:'ACL/PCL rehab, meniscus tears, patellofemoral pain, ankle sprains and Achilles tendinopathy.',
     points:['Patella','ACL / PCL','Meniscus','Tibialis Anterior','Calf Complex','Achilles Tendon','Ankle Mortise','Plantar Fascia'],
     yMin:0.000,yMax:0.470},
  ];

  const canvas=document.getElementById('bm3dCanvas');
  const wrap=document.getElementById('bm3dWrap');
  const loading=document.getElementById('bmLoading');
  const loadBar=document.getElementById('bmLoadBar');
  const loadText=document.getElementById('bmLoadText');
  const nameEl=document.getElementById('bmRegionName');
  const descEl=document.getElementById('bmRegionDesc');
  const listEl=document.getElementById('bmPointsList');
  const badge=document.getElementById('bmBadge');
  const navDots=document.getElementById('bmDots');
  if(!canvas||!wrap)return;

  const renderer=new THREE.WebGLRenderer({canvas,antialias:true,alpha:true});
  renderer.setClearColor(0x080e1a, 1);
renderer.setPixelRatio(Math.min(window.devicePixelRatio,2));
  renderer.toneMapping=THREE.ACESFilmicToneMapping;
  renderer.toneMappingExposure=1.2;
  renderer.outputEncoding=THREE.sRGBEncoding;
  function resize(){
    const w=wrap.clientWidth,h=wrap.clientHeight||580;
    renderer.setSize(w,h);camera.aspect=w/h;camera.updateProjectionMatrix();
  }

  const scene=new THREE.Scene();
  scene.fog=new THREE.FogExp2(0x080e1a,0.035);
  const camera=new THREE.PerspectiveCamera(42,1,0.01,100);
  camera.position.set(0,0.5,2.8);
  scene.add(new THREE.AmbientLight(0xffffff,0.4));
  const key=new THREE.DirectionalLight(0xfff5ee,1.4);
  key.position.set(2,4,3);key.castShadow=true;scene.add(key);
  const fill=new THREE.DirectionalLight(0x88aaff,0.5);fill.position.set(-3,1,-2);scene.add(fill);
  const rim=new THREE.DirectionalLight(0xffeedd,0.7);rim.position.set(0,3,-3);scene.add(rim);
  const grid=new THREE.GridHelper(4,24,0x1a3060,0x1a3060);
  grid.material.opacity=0.25;grid.material.transparent=true;grid.position.y=-0.52;scene.add(grid);
  const glowMesh=new THREE.Mesh(
    new THREE.CircleGeometry(0.6,40),
    new THREE.MeshBasicMaterial({color:0x2979d5,transparent:true,opacity:0.10,side:THREE.DoubleSide})
  );
  glowMesh.rotation.x=-Math.PI/2;glowMesh.position.y=-0.51;scene.add(glowMesh);
  const modelGroup=new THREE.Group();scene.add(modelGroup);

  // Per-vertex colour buffers — one per slide, built once at load time
  // The GLB is one mesh so we colour each vertex based on its world Y position
  let colorBuffers=[];
  let mainMesh=null;
  const DIM=new THREE.Color(0xcdd8e8);  // dim = cool off-white, highlighted region pops with colour

  function buildColorBuffers(mesh){
    const pos=mesh.geometry.attributes.position;
    const n=pos.count;
    // Use PURE LOCAL geometry Y — rotation-proof, no matrixWorld needed
    // Normalise raw local Y values 0-1 (0=lowest vertex=feet, 1=highest=head)
    let minY=1e9,maxY=-1e9;
    for(let i=0;i<n;i++){
      const ly=pos.getY(i);
      if(ly<minY)minY=ly;if(ly>maxY)maxY=ly;
    }
    const span=maxY-minY||1;
    const ny=new Float32Array(n);
    for(let i=0;i<n;i++)ny[i]=(pos.getY(i)-minY)/span;

    colorBuffers=SLIDES.map(s=>{
      const buf=new Float32Array(n*3);
      const hc=new THREE.Color(s.col);
      const soft=0.018; // smooth edge blend
      for(let i=0;i<n;i++){
        const y=ny[i];
        // X constraint: exclude arms from torso-only slides
        const xOk = s.xMax===null || Math.abs(pos.getX(i)) <= s.xMax;
        const t = xOk
          ? Math.min(Math.max((y-(s.yMin-soft))/(2*soft),0),1)*
            Math.min(Math.max(((s.yMax+soft)-y)/(2*soft),0),1)
          : 0;
        buf[i*3]  =DIM.r+(hc.r-DIM.r)*t;
        buf[i*3+1]=DIM.g+(hc.g-DIM.g)*t;
        buf[i*3+2]=DIM.b+(hc.b-DIM.b)*t;
      }
      return buf;
    });

    mesh.geometry.setAttribute('color',new THREE.BufferAttribute(colorBuffers[0].slice(),3));
    mesh.material=new THREE.MeshStandardMaterial({vertexColors:true,roughness:0.82,metalness:0.0,side:THREE.DoubleSide});
  }

  function highlightSlide(id){
    glowMesh.material.color.setHex(SLIDES[id].col);
    glowMesh.material.opacity=0.13;
    if(!mainMesh)return;
    const attr=mainMesh.geometry.attributes.color;
    attr.array.set(colorBuffers[id]);
    attr.needsUpdate=true;
  }

  function loadModel(){
    loadBar.style.width='20%';
    loadText.textContent='Decoding model…';
    setTimeout(()=>{
      try{
        const glbB64='';
        loadBar.style.width='45%';
        loadText.textContent='Parsing geometry…';
        const bin=atob(glbB64);
        const abuf=new ArrayBuffer(bin.length);
        const u8=new Uint8Array(abuf);
        for(let i=0;i<bin.length;i++)u8[i]=bin.charCodeAt(i);
        loadBar.style.width='65%';
        loadText.textContent='Building scene…';
        const loader=new THREE.GLTFLoader();
        loader.parse(abuf,'',
          gltf=>{
            loadBar.style.width='90%';
            loadText.textContent='Preparing…';
            const model=gltf.scene;
            const bb=new THREE.Box3().setFromObject(model);
            const sz=new THREE.Vector3();bb.getSize(sz);
            const ct=new THREE.Vector3();bb.getCenter(ct);
            const sc=1.8/Math.max(sz.x,sz.y,sz.z);
            model.scale.setScalar(sc);
            model.position.set(-ct.x*sc,-bb.min.y*sc-0.50,-ct.z*sc);
            model.traverse(c=>{
              if(!c.isMesh)return;
              c.castShadow=true;c.receiveShadow=true;
              mainMesh=c;
            });
            modelGroup.add(model);
            model.updateWorldMatrix(true,true);
            buildColorBuffers(mainMesh);
            loadBar.style.width='100%';
            setTimeout(()=>{
              loading.style.opacity='0';
              setTimeout(()=>{loading.style.display='none';},600);
              go(0);
            },300);
          },
          err=>{loadText.textContent='Error: '+err.message;loadBar.style.background='#c43030';}
        );
      }catch(e){loadText.textContent='Error: '+e.message;loadBar.style.background='#c43030';}
    },50);
  }

  let drag=false,px=0,py=0,rotY=0.3,rotX=0.05,tRotY=0.3,tRotX=0.05,auto=true;
  canvas.addEventListener('mousedown',e=>{drag=true;px=e.clientX;py=e.clientY;auto=false;});
  window.addEventListener('mouseup',()=>drag=false);
  window.addEventListener('mousemove',e=>{
    if(!drag)return;
    tRotY+=(e.clientX-px)*0.011;tRotX+=(e.clientY-py)*0.005;
    tRotX=Math.max(-0.4,Math.min(0.5,tRotX));px=e.clientX;py=e.clientY;
  });
  let lt=null;
  canvas.addEventListener('touchstart',e=>{lt=e.touches[0];auto=false;},{passive:true});
  canvas.addEventListener('touchmove',e=>{
    e.preventDefault();if(!lt)return;
    const t=e.touches[0];tRotY+=(t.clientX-lt.clientX)*0.013;lt=t;
  },{passive:false});
  canvas.addEventListener('wheel',e=>{
    e.preventDefault();
    camera.position.z=Math.max(1.5,Math.min(6,camera.position.z+e.deltaY*0.005));
  },{passive:false});

  let cur=0;
  SLIDES.forEach((_,i)=>{
    const d=document.createElement('div');
    d.className='bm-dot'+(i===0?' active':'');
    d.addEventListener('click',()=>go(i));
    navDots.appendChild(d);
  });
  document.getElementById('bmPrev').addEventListener('click',()=>go(cur-1));
  document.getElementById('bmNext').addEventListener('click',()=>go(cur+1));

  function go(i){
    cur=((i%5)+5)%5;const s=SLIDES[cur];
    document.querySelectorAll('#bmDots .bm-dot').forEach((d,j)=>d.classList.toggle('active',j===cur));
    badge.textContent=(cur+1)+' / 5  \u2014  '+s.name;
    badge.style.borderLeft='3px solid '+s.hex;
    highlightSlide(cur);
    [nameEl,descEl,listEl].forEach(el=>{el.style.opacity='0';el.style.transform='translateY(8px)';});
    setTimeout(()=>{
      nameEl.textContent=s.name;nameEl.style.color=s.hex;
      descEl.textContent=s.desc;
      listEl.innerHTML=s.points.map((p,j)=>
        '<span class="bm-point-tag" style="animation-delay:'+(j*50)+'ms;border-color:'+s.hex+'55;color:'+s.hex+'">'+p+'</span>'
      ).join('');
      [nameEl,descEl,listEl].forEach(el=>{el.style.opacity='1';el.style.transform='translateY(0)';});
    },180);
  }

  function animate(){
    requestAnimationFrame(animate);
    if(auto)tRotY+=0.003;
    rotY+=(tRotY-rotY)*0.07;rotX+=(tRotX-rotX)*0.07;
    modelGroup.rotation.y=rotY;modelGroup.rotation.x=rotX;
    modelGroup.position.y=Math.sin(Date.now()*0.0008)*0.006;
    renderer.render(scene,camera);
  }

  resize();window.addEventListener('resize',resize);animate();loadModel();
}
window.addEventListener('load',initBodyMap);

/* ── FORM ── */
function handleSubmit(e){
  e.preventDefault();
  var firstName = (document.getElementById('fFirstName')||{}).value || '';
  var lastName  = (document.getElementById('fLastName')||{}).value  || '';
  var phone     = (document.getElementById('fPhone')||{}).value     || '';
  var email     = (document.getElementById('fEmail')||{}).value     || '';
  var service   = (document.getElementById('fService')||{}).value   || 'Not specified';
  var message   = (document.getElementById('fMessage')||{}).value   || '';

  var text = 
    '*New Appointment Request - Revalix*%0A' +
    '-----------------------------%0A' +
    '*Name:* ' + encodeURIComponent(firstName + ' ' + lastName) + '%0A' +
    '*Phone:* ' + encodeURIComponent(phone) + '%0A' +
    '*Email:* ' + encodeURIComponent(email) + '%0A' +
    '*Speciality:* ' + encodeURIComponent(service) + '%0A' +
    '*Condition:* ' + encodeURIComponent(message);

  var waUrl = 'https://wa.me/918089500364?text=' + text;

  var btn = document.getElementById('submitBtn');
  btn.textContent = '✓ Redirecting to WhatsApp...';
  btn.style.background = '#25D366';

  setTimeout(function(){
    window.open(waUrl, '_blank');
    btn.textContent = 'Book Free Consultation';
    btn.style.background = '';
    e.target.reset();
  }, 800);
}





/* ── HERO SERVICES ANIMATION ── */
(function(){
  var cards=document.querySelectorAll('.hsvc');if(!cards.length)return;
  var delays=[150,300,450,600,750];
  cards.forEach(function(c,i){setTimeout(function(){c.classList.add('visible');},700+delays[i]);});
  cards.forEach(function(c,i){var amp=5+(i%3)*3,spd=3200+i*350,t0=Date.now()+i*500;
    (function tick(){if(!c.classList.contains('visible')){requestAnimationFrame(tick);return;}c.style.transform='translateY('+(Math.sin((Date.now()-t0)/spd*Math.PI*2)*amp)+'px)';requestAnimationFrame(tick);})();});
})();

