function openTxModal(id){
  var d=_txData[id]; if(!d) return;
  var imgBg=document.getElementById('txmImgBg');
  var icon=document.getElementById('txmIcon');
  if(d.img){
    imgBg.style.cssText='position:absolute;inset:0;background:url('+d.img+') center top/cover no-repeat;border-radius:14px;';
    icon.style.display='none';
  } else {
    imgBg.style.cssText='position:absolute;inset:0;background:linear-gradient(135deg,'+d.bg+',rgba(12,26,48,.92));border-radius:14px;';
    icon.style.display='flex';
    icon.innerHTML=d.icon.replace(/currentColor/g,d.color);
  }
  document.getElementById('txmTag').textContent=d.tag;
  document.getElementById('txmTag').style.color=d.color;
  document.getElementById('txmTitle').textContent=d.title;
  document.getElementById('txmDesc').textContent=d.desc;
  document.getElementById('txmPoints').innerHTML=d.points.map(function(p){
    return '<li><span style="width:5px;height:5px;border-radius:50%;background:'+d.color+';flex-shrink:0;display:inline-block;margin-right:6px"></span>'+p+'</li>';
  }).join('');
  document.getElementById('txmCta').style.background=d.color;
  document.getElementById('txmBackdrop').classList.add('open');
  document.body.style.overflow='hidden';
}
function closeTxModal(e){
  if(e&&e.target!==document.getElementById('txmBackdrop'))return;
  document.getElementById('txmBackdrop').classList.remove('open');
  document.body.style.overflow='';
}
document.addEventListener('keydown',function(e){if(e.key==='Escape'){['txmBackdrop','gsLb'].forEach(function(id){var el=document.getElementById(id);if(el)el.classList.remove('open');});document.body.style.overflow='';}});




/* gallery */
(function(){
  var s=document.getElementById('gsStrip'),
      fill=document.getElementById('gsFill'),
      bL=document.getElementById('gsBtnL'),
      bR=document.getElementById('gsBtnR');
  if(!s)return;
  var dn=false,sx=0,sl=0,moved=false;
  s.addEventListener('mousedown',function(e){dn=true;sx=e.pageX;sl=s.scrollLeft;moved=false;});
  window.addEventListener('mouseup',function(){dn=false;});
  window.addEventListener('mousemove',function(e){if(!dn)return;e.preventDefault();if(Math.abs(e.pageX-sx)>5)moved=true;s.scrollLeft=sl-(e.pageX-sx);});
  s.querySelectorAll('.gc').forEach(function(c){
    c.addEventListener('click',function(){if(moved)return;
      document.getElementById('gsLbImg').src=c.querySelector('img').src;
      document.getElementById('gsLbLbl').textContent=c.dataset.label||'';
      document.getElementById('gsLbSub').textContent=c.dataset.sub||'';
      document.getElementById('gsLb').classList.add('open');
      document.body.style.overflow='hidden';
    });
  });
  function upd(){var max=s.scrollWidth-s.clientWidth,p=max>0?s.scrollLeft/max*100:0;if(fill)fill.style.width=Math.max(6,Math.min(100,p))+'%';if(bL)bL.disabled=s.scrollLeft<4;if(bR)bR.disabled=s.scrollLeft>=max-4;}
  s.addEventListener('scroll',upd,{passive:true});
  setTimeout(upd,300);
  window.gsScroll=function(d){s.scrollBy({left:d*336,behavior:'smooth'});};
})();
function gsLbClose(e){if(e&&e.target.id!=='gsLb'&&!e.target.closest('.gslb-meta button'))return;document.getElementById('gsLb').classList.remove('open');document.body.style.overflow='';}


